import './App.css';
import Header from './components/header/Header';
import Navbar from './components/navbar/Navbar';
import Features from './components/navbar/Features';
import Download from './components/navbar/Download';
import Subscribe from './components/navbar/Subscribe';
import Faq from './components/navbar/Faq';
import Footer from './components/navbar/Footer';

function App() {
  return (
    <main>
      <header className="header-bg">
        <Navbar/>
        <Header/>
      </header>
      <Features />
      <Download />
      <Subscribe />
      <Faq />
      <Footer />
    </main>
  );
}

export default App;
